import React from 'react';
import './index.css';

const ProductList = (props) => {
	return (
		<div>
			<ul className="Product-list">
				{props.list.map(productlist => (
					<li key={productlist.id}>{productlist.name}</li>
				))}
			</ul>
		</div>
	)
}

export default ProductList;
